import React from "react";
import loginImg from "./logo.svg";

export class Login extends React.Component {
    constructor(props) {
        super(props);
    }

    state = {
      password: "",
      username: ""
    };

    inputChange = (e) => {
        this.setState({
            [e.target.id]: e.target.value
        });
        console.log(this.state)
    };

    render() {
        return (
            <form id="login">
                <div className="container" id="error" style="color: red"/>
                <div className="container">
                    <div className="row">
                        <div className="four columns">
                            <label htmlFor="username">Username</label>
                            <input className="u-full-width" type="text" placeholder="Username" id="username" onChange={this.inputChange}/>
                        </div>
                        <div className="four columns">
                            <label htmlFor="password">Password</label>
                            <input className="u-full-width" type="password" placeholder="Password" id="password" onChange={this.inputChange}/>
                        </div>
                        <div className="four columns">
                            <label htmlFor="submit"></label>
                            <button className="button-primary" id="submit">Login</button>
                        </div>
                    </div>
                </div>
            </form>
        );
    }
}
